package com.somshine.PDFDownload.controller;

import java.io.ByteArrayInputStream;
import java.io.InputStream;
import java.io.OutputStream;
import java.util.Base64;

import org.slf4j.Logger;
import org.slf4j.LoggerFactory;
import org.springframework.core.io.InputStreamResource;
import org.springframework.core.io.Resource;
import org.springframework.http.ContentDisposition;
import org.springframework.http.HttpHeaders;
import org.springframework.http.HttpStatus;
import org.springframework.http.MediaType;
import org.springframework.http.MediaTypeFactory;
import org.springframework.http.ResponseEntity;
import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.PostMapping;
import org.springframework.web.bind.annotation.RestController;

@RestController
public class FileDownload {
	Logger logger = LoggerFactory.getLogger(FileDownload.class);

	@GetMapping(value = "/donwloadPdf")
	public ResponseEntity<Resource> downloadPdf() {
		logger.info("Start the file processing");
		String content = "";
		InputStream is = new ByteArrayInputStream(content.getBytes());
		byte[] decoder = Base64.getDecoder().decode(content);

		is = new ByteArrayInputStream(decoder);

		InputStreamResource resource = new InputStreamResource(is);

		HttpHeaders headers = new HttpHeaders();
		ContentDisposition contentDisposition = ContentDisposition.builder("attachment").filename("test.pdf").build();

		headers.setContentDisposition(contentDisposition);

		logger.info("Sending response");

//	      response.setContentType("application/pdf");
//	      response.setHeader("Content-Disposition", "attachment;filename=myfile-1.pdf");
//	      OutputStream out = response.getOutputStream();
//	      out.write(decoder);
		return ResponseEntity.ok().headers(headers).contentLength(content.getBytes().length)
				.contentType(MediaType.APPLICATION_PDF).body(resource);
	}

	@GetMapping(value = "/donw1")
	public ResponseEntity<Resource> donw1() {
		logger.info("Start the file processing");
		String content = "";
		byte[] decoder = Base64.getDecoder().decode(content);
		InputStream is = new ByteArrayInputStream(decoder);
		InputStreamResource resource = new InputStreamResource(is);
		
		HttpHeaders headers = new HttpHeaders();
		headers.setContentType(MediaType.APPLICATION_PDF);
		
		ContentDisposition disposition = ContentDisposition.attachment().filename("textdown.pdf").build();
		headers.setContentDisposition(disposition);
		
		return new ResponseEntity<>(resource, headers, HttpStatus.OK);
	}
}
